import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

const styles = {
  app: {
    textAlign: 'center',
    backgroundColor: '#f4f4f4',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
  },
  header: {
    backgroundColor: '#333',
    color: 'white',
    padding: '20px',
  },
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '40px',
  },
  logo: {
    marginLeft: '20px',
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navUl: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  navLi: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  loginButton: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '20px',
  },
  sliderContainer: {
    width: '100%',
    maxWidth: '100%',
    margin: '20px 0',
  },
  carouselContainer: {
    boxSizing: 'none',
  },
  carouselImage: {
    width: '100%',
    height: '100%',
    objectFit: 'cover',
  },
  missionSection: {
    marginTop: '30px',
    display: 'flex',
    justifyContent: 'space-around',
    flexWrap: 'wrap',
  },
  missionCard: {
    width: '30%',
    border: '1px solid #ddd',
    borderRadius: '8px',
    overflow: 'hidden',
    margin: '10px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  missionImage: {
    width: '100%',
    height: '200px',
    objectFit: 'cover',
  },
  missionCardContent: {
    padding: '15px',
  },
  missionTitle: {
    fontSize: '1.2rem',
    fontWeight: 'bold',
    marginBottom: '10px',
  },
  missionDescription: {
    fontSize: '1rem',
    color: '#555',
  },
  eventsSection: {
    marginTop: '30px',
    display: 'flex',
    justifyContent: 'space-around',
    flexWrap: 'wrap',
  },
  eventCard: {
    width: '30%',
    border: '1px solid #ddd',
    borderRadius: '8px',
    overflow: 'hidden',
    margin: '10px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  eventImage: {
    width: '100%',
    height: '200px',
    objectFit: 'cover',
  },
  eventCardContent: {
    padding: '15px',
  },
  eventTitle: {
    fontSize: '1.2rem',
    fontWeight: 'bold',
    marginBottom: '10px',
  },
  eventDescription: {
    fontSize: '1rem',
    color: '#555',
  },
  main: {
    flex: 1,
    padding: '20px',
  },
  footer: {
    backgroundColor: '#333',
    color: 'white',
    padding: '20px',
    bottom: 0,
    width: '100%',
  },
};

const Header = () => (
  <header style={styles.header}>
    {/* Removed website name */}
  </header>
);

const NavBar = () => (
  <nav style={styles.nav}>
    <div style={styles.logo}>Logo</div>
    <ul style={styles.navUl}>
      <li style={styles.navLi}>Home</li>
      <li style={styles.navLi}>Our Missions</li>
      <li style={styles.navLi}>About Us</li>
      <li style={styles.navLi}>Clubs</li>
      <li style={styles.navLi}>Contact Us</li>
    </ul>
    <div style={styles.loginButton}>Login</div>
  </nav>
);

const ImageSlider = () => (
  <div style={styles.sliderContainer}>
    <Carousel showThumbs={false} style={styles.carouselContainer} autoPlay infiniteLoop interval={2000}>
      <div>
        <img alt="Slide 1" src="https://via.placeholder.com/800x300" style={styles.carouselImage} />
      </div>
      <div>
        <img alt="Slide 2" src="https://via.placeholder.com/800x300" style={styles.carouselImage} />
      </div>
      <div>
        <img alt="Slide 3" src="https://via.placeholder.com/800x300" style={styles.carouselImage} />
      </div>
    </Carousel>
  </div>
);

const MissionCard = ({ title, description, imageUrl }) => (
  <div style={styles.missionCard}>
    <img alt={title} src={imageUrl} style={styles.missionImage} />
    <div style={styles.missionCardContent}>
      <h3 style={styles.missionTitle}>{title}</h3>
      <p style={styles.missionDescription}>{description}</p>
    </div>
  </div>
);

const EventCard = ({ title, description, imageUrl }) => (
  <div style={styles.eventCard}>
    <img alt={title} src={imageUrl} style={styles.eventImage} />
    <div style={styles.eventCardContent}>
      <h3 style={styles.eventTitle}>{title}</h3>
      <p style={styles.eventDescription}>{description}</p>
    </div>
  </div>
);

const MainContent = () => (
  <main style={styles.main}>
    <ImageSlider />
    <div style={styles.missionSection}>
      <MissionCard
        title="Mission 1"
        description="Description of mission 1. Lorem ipsum dolor sit amet, consectetur adipiscing elit."
        imageUrl="https://via.placeholder.com/800x300"
      />
      <MissionCard
        title="Mission 2"
        description="Description of mission 2. Lorem ipsum dolor sit amet, consectetur adipiscing elit."
        imageUrl="https://via.placeholder.com/800x300"
      />
      <MissionCard
        title="Mission 3"
        description="Description of mission 3. Lorem ipsum dolor sit amet, consectetur adipiscing elit."
        imageUrl="https://via.placeholder.com/800x300"
      />
    </div>
    <h2>Upcoming Events</h2>
    <div style={styles.eventsSection}>
      <EventCard
        title="Event 1"
        description="Description of event 1. Lorem ipsum dolor sit amet, consectetur adipiscing elit."
        imageUrl="https://via.placeholder.com/800x300"
      />
      <EventCard
        title="Event 2"
        description="Description of event 2. Lorem ipsum dolor sit amet, consectetur adipiscing elit."
        imageUrl="https://via.placeholder.com/800x300"
      />
      <EventCard
        title="Event 3"
        description="Description of event 3. Lorem ipsum dolor sit amet, consectetur adipiscing elit."
        imageUrl="https://via.placeholder.com/800x300"
      />
    </div>
    <p>Welcome to my website! This is the main content.</p>
  </main>
);

const Footer = () => (
  <footer style={styles.footer}>
    <p>&copy; 2024 My Website. All rights reserved.</p>
  </footer>
);

function App() {
  return (
    <div style={styles.app}>
      <Header />
      <NavBar />
      <MainContent />
      <Footer />
    </div>
  );
}

export default App;
